import React,{useState} from 'react';
import "./Admin.css"

function Admin() {
    
    const [username, setUsername] = useState()
    const [password, setPassword] = useState()
    return (
        <div className='parent'>
            <div className="content">
                <div className='input-box'>
                    <span className='details'>Username:</span>
                    <input type="text" name='name' className='input-text' onChange={(e) => { setUsername(e.target.value) }} required="required" />
                </div>

                <div className='input-box'>
                    <span className='details'>Password:</span>
                    <input type="text" name='name' className='input-text' onChange={(e) => { setPassword(e.target.value) }} required="required" />
                </div>
            </div>
        </div>
    )
}

export default Admin
